        self.label.setToolTip(_translate("MainWindow", "<html><head/><body><p><span style=\" font-family:\'Courier New\';\">\'from_scratch\' :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:50px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">From scratch. This is the normal way to perform a PWscf calculation</span></pre><p><span style=\" font-family:\'Courier New\';\">\'restart\' :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:50px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">From previous interrupted run. Use this switch only if you want to</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:50px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">continue, using the same number of processors and parallelization,</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:50px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">an interrupted calculation. Do not use to start a new one, or to</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:50px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">perform a non-scf calculations.  Works only if the calculation was</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:50px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">cleanly stopped using variable </span><a href=\"https://www.quantum-espresso.org/Doc/INPUT_PW.html#max_seconds\"><span style=\" font-family:\'Courier New\'; text-decoration: underline; color:#0000ff;\">max_seconds</span></a><span style=\" font-family:\'Courier New\';\">, or by user request</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:50px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">with an &quot;exit file&quot; (i.e.: create a file &quot;prefix&quot;.EXIT, in directory</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:50px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">&quot;outdir&quot;; see variables </span><a href=\"https://www.quantum-espresso.org/Doc/INPUT_PW.html#prefix\"><span style=\" font-family:\'Courier New\'; text-decoration: underline; color:#0000ff;\">prefix</span></a><span style=\" font-family:\'Courier New\';\">, </span><a href=\"https://www.quantum-espresso.org/Doc/INPUT_PW.html#outdir\"><span style=\" font-family:\'Courier New\'; text-decoration: underline; color:#0000ff;\">outdir</span></a><span style=\" font-family:\'Courier New\';\">). The default for</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:50px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><a href=\"https://www.quantum-espresso.org/Doc/INPUT_PW.html#startingwfc\"><span style=\" font-family:\'Courier New\'; text-decoration: underline; color:#0000ff;\">startingwfc</span></a><span style=\" font-family:\'Courier New\';\"> and </span><a href=\"https://www.quantum-espresso.org/Doc/INPUT_PW.html#startingpot\"><span style=\" font-family:\'Courier New\'; text-decoration: underline; color:#0000ff;\">startingpot</span></a><span style=\" font-family:\'Courier New\';\"> is set to \'file\'.</span></pre><p><br/></p></body></html>"))
        self.label.setText(_translate("MainWindow", "Restart Mode"))
