        self.label_9.setToolTip(_translate("MainWindow", "<html><head/><body><pre style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">number of atoms in the unit cell (ALL atoms, except if</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">space_group is set, in which case, INEQUIVALENT atoms)</span></pre></body></html>"))
