        self.comboBox_2.setItemText(4, _translate("MainWindow", "crystal_sg"))
        self.label_18.setToolTip(_translate("MainWindow", "<html><head/><body><pre style=\" margin-top:12px; margin-bottom:0px; margin-left:40px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">K_POINTS options are:</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:40px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">tpiba :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">read k-points in cartesian coordinates,</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">in units of 2 pi/a (default)</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">automatic :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">automatically generated uniform grid of k-points, i.e,</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">generates ( nk1, nk2, nk3 ) grid with ( sk1, sk2, sk3 ) offset.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">nk1, nk2, nk3 as in Monkhorst-Pack grids</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">k1, k2, k3 must be 0 ( no offset ) or 1 ( grid displaced</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">by half a grid step in the corresponding direction )</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">BEWARE: only grids having the full symmetry of the crystal</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">        work with tetrahedra. Some grids with offset may not work.</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">crystal :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">read k-points in crystal coordinates, i.e. in relative</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">coordinates of the reciprocal lattice vectors</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">gamma :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">use k = 0 (no need to list k-point specifications after card)</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">In this case wavefunctions can be chosen as real,</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">and specialized subroutines optimized for calculations</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">at the gamma point are used (memory and cpu requirements</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">are reduced by approximately one half).</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">tpiba_b :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">Used for band-structure plots.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">See Doc/brillouin_zones.pdf for usage of BZ labels;</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">otherwise, k-points are in units of  2 pi/a.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">nks points specify nks-1 lines in reciprocal space.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">Every couple of points identifies the initial and</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">final point of a line. pw.x generates N intermediate</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">points of the line where N is the weight of the first point.</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">crystal_b :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">As tpiba_b, but k-points are in crystal coordinates.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">See Doc/brillouin_zones.pdf for usage of BZ labels.</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">tpiba_c :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">Used for band-structure contour plots.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">k-points are in units of  2 </span><span style=\" font-family:\'Courier New\'; font-style:italic;\">pi/a.</span><span style=\" font-family:\'Courier New\';\"> nks must be 3.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">3 k-points k_0, k_1, and k_2 specify a rectangle</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">in reciprocal space of vertices k_0, k_1, k_2,</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">k_1 + k_2 - k_0: k_0 + \\alpha (k_1-k_0)+</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">\\beta (k_2-k_0) with 0 &lt;\\alpha,\\beta &lt; 1.</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">The code produces a uniform mesh n1 x n2</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">k points in this rectangle. n1 and n2 are</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">the weights of k_1 and k_2. The weight of k_0</span></pre><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">is not used.</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre><p><span style=\" font-family:\'Courier New\';\">crystal_c :</span></p><pre style=\" margin-top:0px; margin-bottom:0px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">As tpiba_c, but k-points are in crystal coordinates.</span></pre><pre style=\" margin-top:0px; margin-bottom:-13px; margin-left:90px; margin-right:40px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\"/></pre></body></html>"))
